import React from "react";

const HR = () => {
    const employees = ["John", "Jane", "Mike", "Emily"];
    const clients = ["Apple", "Microsoft", "Google", "Amazon"];

    return (

        
        <div style={{ display: "flex" }}>
            <div style={{ flex: 1 }}>
                <h1>Employees</h1>
                <ul>
                    {employees.map((employee) => (
                        <li key={employee}>{employee}</li>
                    ))}
                </ul>
            </div>
            <div style={{ flex: 1 }}>
                <h1>Clients</h1>
                <ul>
                    {clients.map((client) => (
                        <li key={client}>{client}</li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

export default HR;
